import { Link } from 'react-router-dom';
import s from './NewSection.module.css';

const NewSection = () => {
	return (
		<div className={s.new}>
			<div className={s.new_header}>
				<h2>Нове</h2>
				<Link to={'2024'}>link</Link>
			</div>
		</div>
	);
};

export default NewSection;
